import React from 'react';
import './ContentBox.css';

const ContentBox = () => {
  return (
    <div className="content-box">
      <h1 className="content-heading">Working with you for a better financial future</h1>
      <p className="content-text">Dimov Tax is a full-service accounting firm dedicated to maximizing your financial benefits for both Individual Tax and your Business Tax Services. </p>
    </div>
  );
};

export default ContentBox;
